INSERT INTO `product` VALUES (26, 'THÔNG TIN VÉ\nĐịa điểm sử dụng: KDL Bà Nà Hills, thôn An Sơn, xã Hòa Ninh, Hòa Vang, Đà Nẵng\nThời gian hoạt động: 8h – 18h hằng ngày\nLoại vé: vé giấy\nHình thức nhận vé: Nhân viên Vi Vu Đà Nẵng giao vé cho Quý khách tại phòng vé lữ hành ngay cổng KDL Sunworld Bà Nà Hills (vui lòng đặt vé trước 17h trước 1 ngày sử dụng)\n\nCHÍNH SÁCH GIÁ VÉ\nChiều cao dưới 1m: Miễn phí\nChiều cao từ 1m-1m4: tính giá trẻ em\nChiều cao trên 1m4: tính giá người lớn\n\nTHỜI GIAN SỬ DỤNG:\nGiá vé cáp treo: áp dụng từ 02/05/2021 đến hết 31/12/2021\nGiá vé cáp treo và ăn trưa:  \n* 30/04/2021 - 30/09/2021: giá vé 910.000đ/Người lớn - 580.000đ/Trẻ em\n* 1/10/2021 - 31/12/2021: giá vé 810.000đ/Người lớn - 610.000đ/Trẻ em\n\nBAO GỒM\n-Trải nghiệm cáp treo với nhiều kỉ lục, trong đó chặng dài nhất đang giữ đến tận 2 kỷ lục thế giới - hệ thống cáp treo một dây dài nhất thế giới (5.801m) và tuyến cáp có độ cao chênh lệch giữa ga đi và ga đến cao nhất thế giới (1.368m). Cáp treo gồm 3 chặng: Suối Mơ – Bà Nà, Debay – Morin, Thác Tóc Tiên – L’Indochine\n\n- Chơi hơn 105 trò chơi miễn phí ở khu Fantasy Park rộng hơn 21000 mét vuông, với các hoạt động như:\n  + Tháp rơi tự do trong nhà cao nhất Việt Nam với độ cao 29m.\n  + Rạp chiếu phim 3D Mega 360 độ với công nghệ hiện đại nhất \n  + Vòng đua tử thần 4D và bắn súng miền tây hoang dã 5D\n  + Hành trình trở về kỷ Jura - chuyến thám hiểm về thời đại của loài bò sát khổng lồ \n  + Và nhiều trò chơi trong nhà hấp dẫn khác\n\n-Một vài hoạt động khác:\n  + Tham quan, chiêm ngưỡng Cầu Vàng\n  + Du ngoạn bằng tàu hỏa leo núi và xe trượt ống\n  + Tham gia máng trượt Hiệp sỹ thần thoại\n  + Tham quan hầm rượu Debay\n  + Viếng thăm các điểm đến tâm linh: Trú Vũ Trà Quán, chùa Linh Ứng, Linh Phong thiền tự, Linh Phong bảo tháp, Lĩnh chúa Linh từ,...\n  + Tham quan kiến trúc Pháp cổ điển trong khu Làng Pháp\n  + Chiêm ngưỡng các show diễn ở Bà Nà Hills\n\nKHÔNG BAO GỒM\n- Xe đưa đón \n- Chi phí khác ngoài mục Bao gồm\n- Vé vào bảo tàng tượng sáp\n- Chi phí cá nhân\n\nĂN TRƯA BUFFET TẠI NHÀ HÀNG \n- Thưởng thức buffet trưa với menu hơn 50 món ăn phong phú, Quý khách được thoải mái lựa chọn món ăn theo sở thích và tận hưởng bữa ăn thật tuyệt vời tại đây.\n- Thời gian phục vụ buffet: từ 11h00-14h00 hằng ngày\n', '[E-Ticket] Combo vé Bà Nà Hills + ăn trưa buffet - Cáp treo', 580000, 80, 15);
INSERT INTO `product` VALUES (27, 'HƯỚNG DẪN SỬ DỤNG E-VOUCHER\n1. Quý khách có thể xuất trình voucher in sẵn hoặc voucher trên điện thoại để sử dụng dịch vụ hoặc đổi vé cứng tại quầy vé\n2. E-voucher chỉ có giá trị vào ngày, giờ đã định\n3. E-voucher không có giá trị quy đổi thành tiền mặt\n\nTHÔNG TIN VÉ\nDịch vụ bao gồm:\n  Các vé khán đài 1,2,3,4,5.\nDịch vụ không bao gồm: \n- Hướng dẫn viên\n- Đón khách và trả khách tại khách sạn\n- Bữa ăn và đồ uống\n- Chi phí cá nhân khác\n- Tiền típ\n\nĐIỀU KHOẢN CHUNG\n- Không được mang thức ăn và nước uống bên ngoài vào;\n- Trẻ em có chiều cao từ 99cm trở xuống có thể vào miễn phí;\n- Mang theo CMND khi đổi vé tại quầy.', '[E-Ticket] Vé Đêm Hội Pháo Hoa Quốc Tế Đà Nẵng DIFF 2023', 800000, 200, 15);
INSERT INTO `product` VALUES (28, 'ĐIỂM NỔI BẬT\n- Chỉ với 25 phút thảnh thơi trong cabin cáp treo và những chuyến tàu hỏa leo núi có 1-0-2 ở Việt Nam, Du khách đã có thể chạm tay tới cộc mốc 3.143m huyền thoại.\n- Ngoài tuyệt cảnh núi rừng, các công trình đồ sộ Sun World Fansipan Leagend còn mang đến cho bạn hương vị Tây Bắc tại nhà hàng buffet độc đáo. Bên cạnh hương vị núi rừng Bạn có thể nhâm nhi tách cà phê tại Café Du Soleil – Nơi được mệnh danh là Quán café cao nhất Đông Dương.\n\nQUY TRÌNH ĐẶT E-VOUCHER VÉ THAM QUAN\nB1: Du khách đọc kỹ thông tin chi tiết về dịch vụ ở phần mô tả. Để được tư vấn nhanh chóng vui lòng nhắn tin hoặc liên hệ trực tiếp qua Hotline 0774 467 442/0899 208 488.\nB2: Du khách vui lòng chọn loại dịch vụ/vé/gói và số lượng cần đặt.\nB3: Tiến hành thanh toán và hoàn thành thao tác đặt hàng.\nB4: Lambaba sẽ liên hệ với Du khách để xác nhận lại thông tin và gửi E-voucher qua tin nhắn điện thoại.\n* Du khách vui lòng kiểm tra kỹ thông tin số điện thoại để sớm nhận được Voucher từ Lambaba.\n\nHƯỚNG DẪN SỬ DỤNG E-VOUCHER\n1. Du khách có thể xuất trình voucher in sẵn hoặc voucher trên điện thoại để sử dụng dịch vụ hoặc đổi vé cứng tại quầy vé.\n2. E-voucher chỉ có giá trị vào ngày, giờ đã định.\n3. E-voucher không có giá trị quy đổi thành tiền mặt.\n\nTHÔNG TIN VÉ\n- Thời gian mở cửa: Thứ Hai - Chủ Nhật từ 06:00 - 17:00\n- Dịch vụ bao gồm:\n       + Vé Cáp treo\n       + Combo Cáp treo & Buffet trưa\n   \n- Dịch vụ không bao gồm\n       + Hướng dẫn viên\n       + Đón khách và trả khách tại khách sạn\n       + Bữa ăn và đồ uống\n       + Chi phí cá nhân khác\n\nĐIỀU KHOẢN CHUNG\n- Không được mang thức ăn và nước uống bên ngoài vào.\n- Trẻ em có chiều cao từ 99cm trở xuống có thể vào miễn phí.\n- Mang theo CMND khi đổi vé tại quầy.\n', '[E-Ticket] Du lịch Đà Nẵng - Sa Pa - Cáp Treo & Buffet ', 550000, 150, 15);
INSERT INTO `product` VALUES (30, 'Đón mùa hè rộn ràng với TOUR 4 ĐẢO PHÚ QUỐC siêu đỉnh!\n\nMùa hè này Việt Úc Tourist hứa hẹn vô vàng điều thú vị đang chờ các bạn khám phá Đảo Ngọc xinh đẹp.\n\n----------\n\n🔷Combo tour 4 đảo Phú Quốc – Mây Rút Luxury:\n\n🔹Trải nghiệm cano siêu tốc , hiện đại bậc nhất , tham quạn 4 hòn đảo đẹp nhất\n\n🔹Hòn Mây Rút Ngoài với bờ biển trong xanh cùng cát trắng mịn trải dài\n\n🔹Hòn Móng Tay: Check in - tắm biển một trong những hòn đảo được mệnh danh là maldives của Việt Nam \n\n🔹Hòn Gầm Ghì: Lặn ngắm san hô tự nhiên , lưu lại khoảnh khắc của bạn tại đây cùng với ván SUP bằng FLYCAM cực kỳ xinh đẹp ,hoàn toàn miễn phí \n\n🔹Hòn Mây Rút Trong: Nghỉ ngơi - tắm biển, check in mọi lúc mọi nơi , quay video FLYCAM thật xịn xò \n\n🔹Cano tham quan chuyên dụng đời mới, 100% có đăng kiểm và trang bị đầy đủ đồ bảo hộ trẻ nhỏ và người cao tuổi đều có thể có những trải nghiệm tốt nhất.\n\n🔹Phục vụ ăn trưa trên đảo gồm thực đơn 8 món.\n\n🔹Xe đưa rước khách miễn phí tại khách sạn, resort trong khu vực Dương Đông và các khách sạn dọc đường Trần Hưng Đạo đến Cảng An Thới.\n\n🔹Quay tặng 1 clip flycam.\n\n🔹Chụp ảnh với phao nổi bằng flycam.\n\n🔹Tặng 1 chai nước suối /khách trên cano tham quan .\n\n🔹Các trang thiết bị lặn ngắm san hô hiện đại: Áo phao, kính lặn, ống thở...\n\n----------\n\n🔷HƯỚNG DẪN ĐẶT TOUR: \n\n- Bước 1: Inbox Vietuc Tourist để kiểm tra suất đi và giữ chỗ. \n\n- Bước 2: Hoàn thành thao tác mua hàng và thanh toán trên Shopee. \n\n- Bước 3: Vietuc Tourist sẽ liên hệ ngay với quý khách hàng để xác nhận thông tin khách và hoàn tất đặt tour. \n\n- Bước 4: Khách sẽ được nhận booking confirm qua Email/ SMS từ Vietuc Tourist. \n\n---------\n\n🔷ĐIỀU KIỆN VÀ ĐIỀU KHOẢN ÁP DỤNG: \n\n- Voucher chỉ áp dụng sử dụng 1 lần\n\n- Voucher không có giá trị quy đổi thành tiền mặt\n\n- Voucher không áp dụng hoàn, hủy, đổi\n\n- Voucher có thể sử dụng trong dịp Lễ, Tết (có tính phụ thu theo quy định của du thuyền)\n\n- Có hỗ trợ xuất hóa đơn VAT (thêm phí)\n\n- Mang theo Giấy tờ là Căn cước công dân hoặc Hộ chiếu khi nhận phòng\n\n- Trẻ em đi kèm mang theo Giấy khai sinh.\n\n- Nhận phòng, trả phòng theo quy định chung của du thuyền\n\n- Quy định phòng dịch Covid theo công văn hiện hành', '[E-Ticket] Tour du lịch khám phá 4 đảo Mây Rút Luxury', 700000, 50, 24);
INSERT INTO `product` VALUES (31, 'TRẢI NGHIỆM CẢM GIÁC SANG TRỌNG BỮA TỐI 5 SAO TRÊN DU THUYỀN INDOCHINA QUEEN 💕💕\n\nLưu ý : cần kiểm tra tình trạng chổ ngồi trước khi thanh toán.\n\nInbox để nhận ưu đãi giảm 14%\n\nTẦNG 1 : 567.000đ phục vụ ăn buffet.\n\nTẦNG 2 :  626.000đ phục vụ ăn buffet.\n\nTẦNG 3 :  683.000đ phục vụ ăn buffet.\n\n* GIÁ VOUCHER CHỈ ÁP DỤNG CHO NGÀY THƯỜNG, KHÔNG ÁP DỤNG CHO LỄ TẾT!\n\n---------------\n\n*Bao gồm: \n\n▶️Vé lên du thuyền 5 sao Indochina Queen \n\n▶️Du Thuyền chạy du ngoạn trên Sông Sài Gòn tham quan theo chương trình\n\n\n\nPhòng VIP phục vụ các set Indo 7 đến Set Indo 17.  \n\n------------\n\n*Chưa bao gồm: Đưa đón và nước uống trên tàu, quý khách lên tàu sẽ lựa chọn nước uống yêu thích và thanh toán trực tiếp cho Du Thuyền.\n\n\n\n----------\n\n🕣Lịch trình tàu chạy: \n\n18 giờ 00 - đón khách \n\n19 giờ 45 - tàu chạy (tàu sẽ di chuyển 1h30\' trên sông)\n\n\n\nMenu: \n\n1. Gỏi ngũ sắc\n\n2. Salad Nga\n\n3. Canape tôm\n\n4. Canapé Thịt nguội\n\n5. Canape với cà chua + dưa leo\n\n6. Súp cua với nầm kim châm trứng cút\n\n7. Gỏi cuốn tôm thịt\n\n8. Khoai tây chiên\n\n9. Chả giò hải sản\n\n10. File cá chiên giòn\n\n11. Mực hấp hành gừng\n\n12. Chạo tôm quấn mía\n\n13. Sushi tôm\n\n14. Sushi với hải sản\n\n15. Sushi rau củ\n\n16. Cá viên chiên\n\n17. Rau thập cẩm hấp\n\n18. Cánh gà chiên nước mắm\n\n19. Bò cuộn lá lốt\n\n20. Tôm hấp kiểu Thái\n\n21. Sò dẹo nướng mỡ hành\n\n22. Ốc cà na cháy tỏi\n\n23. Ốc bươu sốt cay\n\n24. Gà nướng mật ong\n\n25. Xúc xích nướng\n\n26. Sườn heo nấu nấm + bánh mì\n\n27. Cơm chiên Dương Châu\n\n28. Mỳ ý sốt thịt bò bằm\n\n29. Rau câu\n\n30. Bánh bông lan khúc gỗ\n\n31. Bánh quy gừng\n\n32. Bánh bông tuyết\n\n33. Trái cây ( 03 loại )\n\n--------\n\n*Lưu ý:\n\n• Giá trong thực đơn chưa bao gồm VAT.\n\n• Những thực đơn có món Lẩu 4 khách trở lên mới làm, dưới 4 khách đổi món Lẩu = Mì xào hải sản/Mì xào bò/Cơm chiên hải sản (trường hợp khách vẫn muốn sử dụng Lẩu phụ thu 50.000/khách)\n\n• Em bé 4 ~ 9 tuổi tính 50%, 10 tuổi trở lên tính 100%, thực đơn có Tôm Càng/Cua em bé 4 ~ 9 tính 70%\n\n• Đặt ăn 1pax phụ thu 100.000, những thực đơn có Cá Sapa, Cá Tai Tượng, Cá Điêu Hồng = file cá chiên\n\n• 1 group đặt 1 thực đơn giống nhau\n\n\n\nHotline đặt vé 090 789 1414', '[E-Ticket] bữa tối 5 sao trên du thuyền Indochina Queen', 588000, 200, 25);
INSERT INTO `product` VALUES (32, 'TOUR LÀNG HOA SA ĐÉC – VƯỜN QUÝT HỒNG LAI VUNG \n\n\n\nCác điểm tham quan trong chương trình \n\n👉Làng Hoa kiểng Tân Quy Đông\n\n👉Làng Hoa Sa Đéc  ⚘  \n\n👉Chùa Lá Sen (Chùa Phước Kiểng)\n\n👉Vườn Quýt Hồng Lai Vung   \n\n\n\n🎯Dịch vụ bao gồm :\n\n 👉Ăn sáng : Tô + Ly   tại nhà hàng Mekong Rest Stop\n\n 👉Ăn trưa: Nhà hàng miêtj vườn với thực đơn mang hương vị đồng quê đậm chất Nan Bộ\n\n 👉Xe du lịch đời mới đưa đón tham quan suốt tuyến\n\n 👉Hướng dẫn viên vui vẻ nhiệt tình, hỗ trợ đoàn tham quan suốt tuyến.  \n\n\n\n🎁Quà tặng:\n\n 👉Nón du lịch / người / ngày\n\n 👉Nước suối / người / ngày \n\n 👉Khăn lạnh / người / ngày\n\n 👉Ưu đãi Shopee Mall: Nhập mã DULICH500 giảm ngay 20% giá tour\n\n\n\n🔷ĐỊA ĐIỂM ĐÓN KHÁCH:\n\n1. Đón tại Việt Úc Tourist: 56/12/2 Linh Đông, F. Linh Đông, TP. Thủ Đức, lúc 05h00\n\n2. Đón tại Ngã tư Thủ Đức. lúc 05h20\n\n3. Đón tại Hàng Xanh, Ngay cây xăng số 3, lúc 06h00\n\n4. Đón tại Nhà văn hóa Thanh Niên: 04 Phạm Ngọc Thạch, F. Bến Nghé – Q.1, lúc 06h20\n\n---------\n\n🔷TOUR BAO GỒM: \n\n- Xe 16/29 chỗ, tùy theo số lượng, tham quan theo chương trình.  \n\n- Nước uống: 02 chai 0,5 lít /khách/ngày, khăn lạnh, nón du lịch. \n\n- Bảo hiểm du lịch: 50.000.000vnđ/khách/vụ. \n\n- HDV chăm sóc phục vụ đoàn, thuốc y tế thông thường. \n\n- Tham quan các điểm theo chương trình. ', '[E-Ticket] Tour du lịch TẾT 2023 Làng hoa Long An', 1200000, 19, 26);
INSERT INTO `product` VALUES (33, 'ĐIỂM NỔI BẬT\n- Sun World BaDen Mountain là điểm đến thú vị để tránh nắng nóng oi ả, ngắm nhìn cảnh sắc hùng vĩ của “Nóc nhà Nam Bộ” và chiêm ngưỡng “vùng đất Thánh” với khu di tích lịch sử, quần thể tâm linh độc đáo.\n- Sun World BaDen Mountain cung cấp 2 tuyến cáp treo phục vụ thuận tiện cho nhu cầu tham quan của du khách.\n- Trên hành trình khám phá Sun World Ba Den Mountain, Du khách còn được thưởng thức những món ăn hấp dẫn và đẳng cấp.\n\nQUY TRÌNH ĐẶT E-VOUCHER VÉ THAM QUAN\nB1: Du khách đọc kỹ thông tin chi tiết về dịch vụ ở phần mô tả. Để được tư vấn nhanh chóng vui lòng nhắn tin hoặc liên hệ trực tiếp qua Hotline 0774 467 442/0899 208 488.\nB2: Du khách vui lòng chọn loại dịch vụ/vé/gói và số lượng cần đặt.\nB3: Tiến hành thanh toán và hoàn thành thao tác đặt hàng.\nB4: Lambaba sẽ liên hệ với Du khách để xác nhận lại thông tin và gửi E-voucher qua tin nhắn điện thoại.\n* Du khách vui lòng kiểm tra kỹ thông tin số điện thoại để sớm nhận được Voucher từ Lambaba.\n\nHƯỚNG DẪN SỬ DỤNG E-VOUCHER\n1. Quý khách có thể xuất trình voucher in sẵn hoặc voucher trên điện thoại để sử dụng dịch vụ hoặc đổi vé cứng tại quầy vé.\n2. E-voucher chỉ có giá trị vào ngày, giờ đã định.\n3. E-voucher không có giá trị quy đổi thành tiền mặt.\n\nTHÔNG TIN VÉ\n- Thời gian mở cửa: Thứ Hai - Chủ Nhật từ 06:00 - 17:00\n- Dịch vụ bao gồm:\n       + Vé cáp treo tuyến Vân Sơn lên Đỉnh khứ hồi (2 chiều): Từ chân núi lên đỉnh\n       + Vé cáp treo tuyến Tâm An lên Đỉnh khứ hồi (2 chiều): Từ Chùa Hang lên đỉnh\n       + Vé cáp treo lên Chùa Hang khứ hồi ( 2 chiều): Từ chân núi đến Chùa Hang\n       + Vé combo cáp treo tuyến Vân Sơn + Tâm An + Chùa Hang khứ hồi (2 chiều)\n       + Vé combo cáp treo tuyến Vân Sơn lên đỉnh khứ hồi + Buffet\n       + Vé All in one bao gồm cáp treo tuyến Vân Sơn + Tâm An + Chùa Hang khứ hồi + Buffet\n- Dịch vụ không bao gồm:\n       + Hướng dẫn viên\n       + Đón khách và trả khách tại khách sạn\n       + Bữa ăn và đồ uống\n       + Chi phí cá nhân khác\n\nĐIỀU KHOẢN CHUNG\n- Không được mang thức ăn và nước uống bên ngoài vào.\n- Trẻ em có chiều cao từ 99cm trở xuống có thể vào miễn phí.\n- Mang theo CMND khi đổi vé tại quầy.', '[E-Ticket] Vé Tham Quan Khu Du Lịch Núi Bà Đen', 499000, 80, 27);
INSERT INTO `product` VALUES (34, 'Đầu khởi hành: TP. HỒ CHÍ MINH\n\nNgày khởi hành: \n\n18, 25/12/2022\n\n19, 26/02/2023\n\n \n\nQuy trình sử dụng EVoucher:\n\nBước 1: Quý khách thanh toán thành công.\n\nBước 2: Trong vòng 24h, Vietravel sẽ liên hệ Quý khách để gửi phiếu xác nhận Dịch vụ.\n\nBước 3: Vietravel hỗ trợ Quý khách chọn ngày khởi hành phù hợp (tùy thuộc vào tình trạng chỗ trống của dịch vụ vé máy bay, xe di chuyển, khách sạn, tour trọn gói tại thời điểm đặt dịch vụ); cũng như tư vấn các thủ tục hồ sơ cần thiết.\n\nBước 4: Quý khách cung cấp danh sách khách đi du lịch, danh sách xếp phòng (nếu có), hồ sơ theo yêu cầu (nếu có).\n\n**Quý khách cần mang theo CMND/Passport (Hộ chiếu) bản chính còn hạn sử dụng/ Giấy khai sinh bản chính (trẻ em dưới 14 tuổi) khi đặt dịch vụ và làm thủ tục hàng không, nhận phòng.\n\nĐiều kiện hoàn/hủy: \n\n- Dịch vụ không hoàn, không hủy, không đổi. Trường hợp hoàn, hủy, đổi dịch vụ mất 100% trên giá trị EVoucher.\n\nNDSGN867\n\n\n\nNgày 1 - TP. HCM - MỸ THO - CỒN THỚI SƠN - BẾN TRE - “SỞ THÚ THU NHỎ CỦA TIỀN GIANG” (Ăn trưa)\n\nQuý khách tập trung tại Vietravel (190 Pasteur, P.Võ Thị Sáu, Q.3, TP.HCM), đoàn khởi hành đến Tiền Giang tham quan chùa Vĩnh Tràng - ngôi chùa thờ phật lớn nhất tỉnh Tiền Giang, được xếp hạng di tích lịch sử - văn hóa cấp quốc gia năm 1984. Chùa mang dáng vẻ kiến trúc châu Á pha lẫn châu Âu, bên trong chùa vẫn mang đậm lối kiến trúc điêu khắc truyền thống Việt Nam.\n\nDi chuyển đến bến tàu du lịch Mỹ Tho bắt đầu hành trình du ngoạn trên sông Mekong:\n\n- Chiêm ngưỡng Cầu Rạch Miễu: cầu dây văng đầu tiên do kỹ sư Việt Nam thiết kế và xây dựng, nghe giới thiệu các cù lao Long - Lân - Quy - Phụng.\n\n-  Ngắm nhìn cảng cá Mỹ Tho, làng nuôi cá bè dọc sông Tiền, thưởng thức nước dừa tươi trên tàu.\n\n- Đến cù lao Thới Sơn, tản bộ trên đường làng, tham quan vườn cây ăn trái, thưởng thức các loại trái cây theo mùa và nghe đờn ca tài tử Nam Bộ.\n\n- Đi xuồng chèo len lỏi trong rạch nhỏ ngắm nhìn phong cảnh bình dị vùng sông nước, đến tham quan trại nuôi ong mật, thưởng thức trà mật ong, rượu chuối hột…\n\n- Tiếp tục, xuôi dòng sông Tiền đến Tân Thạch (Bến Tre) tham quan lò kẹo dừa đặc sản Bến Tre, làng nghề thủ công mỹ nghệ truyền thống. Dùng đò máy khám phá con Rạch (Tân Thạch) tìm hiểu cuộc sống thường nhật của người dân miền quê. \n\n- Sau khi ăn trưa, đoàn nằm võng nghỉ ngơi, tham quan trại nuôi cá sấu, nhím, ếch… và đi xe đạp quan vườn dừa… Ngoài ra, Quý khách có thể tham gia các trò chơi dân gian như: đi dây, đu dây, chạy xe đạp mạo hiểm qua ván, đua xuồng chèo trên hồ, nhảy xa.\n\nVề lại bến tàu, đoàn khởi hành tham quan:\n\n- Trại Rắn Đồng Tâm được ví như “Sở thú thu nhỏ của Tiền Giang”: với diện tích phủ xanh hơn 30 ha, nơi đây không chỉ là viện bảo tàng rắn lớn nhất Việt Nam, du khách còn có thể khám phá không gian sinh sống của nhiều loài thú khác như kangaroo, rồng đất, vượn má vàng, chồn hương, đà điểu, gấu chó, hổ… và những chú trăn khổng lồ.\n\nQuý khách khởi hành về TP.HCM, xe đưa đoàn về điểm đón ban đầu, kết thúc chương trình du lịch.\n\n\n\nGiá tour bao gồm\n\n- Xe tham quan (16, 29,30, 34, 45 chỗ tùy theo số lượng khách)\n\n- Hướng dẫn viên tiếng Việt.\n\n- Ăn theo chương trình: 01 bữa trưa giá 110,000đ/ khách,\n\n- Vé tham quan theo chương trình.\n\n- Bảo hiểm du lịch với mức bồi thường cao nhất 120.000.000đ/vụ.\n\n- Nước suối: 01 chai 0,5L/ ngày/ khách.\n\n- Nón Vietravel.\n\n- Thuế VAT', '[E-Ticket] Vé tham quan Mỹ Tho - Thới Sơn - Bến Tre', 588000, 80, 28);

